(17, '32GB G.Skill Trident Z Neo DDR4-3600 DIMM CL16 Dual Kit', 'Speicherleistung und lebendige RGB-Beleuchtung für jeden Gaming-PC oder jede Workstation mit AMD Ryzen™ 3000 CPUs und AMD X570 Mainboards.\r\n\r\nDer Trident Z Neo wurde entwickelt, um die Speicherleistung mit den neuesten Prozessoren der AMD Ryzen 3000 Serie auf der X570-Plattform zu skalieren, und ist optimiert, um die Plattform auf ihre maximale Geschwindigkeit zu bringen.\r\n\r\nEntworfen mit einem Kontrast aus schwarzem gebürstetem Aluminium und pulverbeschichtetem Silber, verleiht der Trident Z Neo zweifarbige Wärmeverteiler Ihrer nächsten Generation Kraft und Kühnheit.\r\n\r\nInspiriert von den Rennstreifen von Sportwagen und Supersportwagen, verfügt der Trident Z Neo über eine abgeschrägte Kante an der Oberseite des charakteristischen Tri-Finnen-Designs mit der asymmetrischen Neigung für einen eleganten und sauberen Look.\r\n\r\nJedes Modul wurde mit handgefertigten Speicher-ICs und kundenspezifischen 10-Lagen-Leiterplatten hergestellt und ist für die Aufrechterhaltung der besten Signalintegrität und schnelle Übertaktungsleistung ausgelegt.\r\n\r\nDie Trident Z-Serie von G.Skill umfasst verschiedene Unterkategorien wie RGB, Royal und Neo. Eines haben jedoch alle gemeinsam: Sie zeichnen sich durch extrem niedrige Latenzen und einzigartige Leistung aus. Die hohe Stabilität sorgt für endlose Stunden Vergnügen. Moderne Designs runden den RAM ab.\r\n\r\nHohe Taktfrequenzen von bis zu 3.600 MHz in Kombination mit niedrigen Latenzen und Overclocking sorgen für beste Voraussetzungen. Kompromisslose Leistung erlaubt es, selbst bei sehr CPU-lastigen Anwendungen beste Ergebnisse zu erzielen.\r\n\r\n\r\nDie G.Skill Trident Z-Serie präsentiert sich nicht nur in verschiedenen Designs. Sie eignet sich auch für diverse Systeme und harmoniert mit vielen Komponenten. Mit AMD-Hardware werden die Vorteile besonders deutlich.\r\n\r\n\r\nTrident Z RAM sind ausschließlich auf DDR4-Basis erhältlich. Benötigen Sie CPU mit DDR3-Slot, erwarten Sie bei G.Skill andere Serien für performantes Gaming.\r\n\r\n\r\nJe nach RAM sind Taktraten von 2.400 MHz bis zu 4.600 MHz möglich. Single Kits erhalten Sie mit einer Gesamtkapazität von 8 bis 16 GB, Dual/Quad-Kits mit 16 bis 32 GB.\r\n\r\nModellname:	Trident Z Neo\r\nGesamtkapazität:	32GB\r\nAnzahl der Module:	2x\r\nKapazität der Einzelmodule:	16GB\r\nArt des Speichers:	DDR4-3600\r\nJEDEC Norm:	PC4-28800U\r\nSpeichertyp:	unbuffered\r\nBauform:	DIMM\r\nSpeicherinterface:	DDR4\r\nMax. Frequenz:	3600MHz\r\nVerpackung:	Dual Kit\r\nSpannung:	1.35V\r\nAnschluss des Speichers:	288-pin\r\nLatenz (CL):	CL16\r\nRAS to CAS Delay (tRCD):	19\r\nRas Precharge Time (tRP):	19\r\nRow Active Time (tRAS):	39\r\nBesonderheiten:	RGB-Beleuchtung, XMP 2.0 Unterstützung', 50, '194.00', '230.00', 182, '2022-04-13 06:55:38', '2022-05-25 14:28:27', 1),
(18, 'AMD Ryzen 7 5800X 8x 3.80GHz So.AM4 WOF', 'Konzipiert, um Erwartungen zu übertreffen\r\nDer Prozessor aus der Vermeer-Familie mit Zen-3-Architektur ist nicht ohne Grund ein Elite-Gaming-Modell. Er verfügt über 8 CPU-Kerne, 16 Threads und einer Taktrate von 3.80 bis 4.70 GHz. Gaming mit hohen FPS ist also kein Problem. Wie alle CPUs der 5000er Ryzen™-Serie verringert der neu gestaltete L3-Cache mit 32MB Latenzen\r\n\r\nAMD Ryzen™ Prozessoren bieten die besten Features, um im Spiel zu bleiben.\r\nNeueste Technologien zur Unterstützung außergewöhnlicher Performance. Alle AMD Ryzen™ 5000 Prozessoren bieten eine vollständige Suite von Technologien, die für mehr Performance auf Ihrem PC sorgt - darunter Precision Boost 2, Precision Boost Overdrive und PCIe® 4.0.\r\n\r\nAMD Ryzen™ Prozessoren sind einfach konfigurierbar und anpassbar.\r\nFür einander geschaffen. Mainboards mit neuestem AMD 500 Chipsatz und AMD Ryzen 5000 Prozessoren. Optimiere den neuen Ryzen™ 5000 mit Ryzen™ Master und AMD StoreMI.\r\n\r\nDie \"Zen 3\"-Architektur basiert auf dem neuen \"Unified Complex\"-Konzept, das 8 Kerne und einen 32-MB-L3-Cache zu einer einzigen Ressourcengruppe vereint. Mehr Anweisungen pro Takt und geringere Latenzen sind insbesondere für PC-Spiele ein großer Vorteil. 19 % höhere Befehlsraten pro Zyklus und geringere Latenz gehen ganz ohne eine Erhöhung des Stromverbrauchs einher.\r\n\r\nWie alle Ryzen-CPUs verfügt auch der 5800X-Prozessor werksseitig über einen freigeschalteten Multiplikator, um die Leistung exakt auf die eigenen Anforderungen anpassen zu können.\r\n\r\nWer gern in die Virtual Reality abtaucht, ist beim AMD Ryzen™ 7 5800X beim richtigen Prozessor angekommen. Die VR-Ready-Prozessoren geben Gewissheit, dass genügend Rechnerleistung für die Workloads von VR-Erlebnissen vorhanden ist. Die Modelle mit diesem Label erfüllen oder übertreffen sogar die minimalen Spezifikationen für Prozessoren der aktuell besten VR-HMD-Hersteller wie Oculus Rift, HTC Vive oder Microsoft Windows® Mixed Reality.', 51, '309.00', '328.00', 199, '2022-04-13 06:58:20', '2022-05-25 13:12:29', 1),
(19, 'Samsung C49HG90DMR', 'Samsung C49HG90DMR - 49 Zoll, UltraWide Full HD (3840 x 1080), VA-Panel, 144Hz, 1ms, 350cd/m², DisplayHDR 600 (LC49HG90DMRXEN)', 104, '718.00', '718.00', 199, '2022-04-13 06:58:38', '2022-05-25 13:12:29', 1),
(20, 'AMD Ryzen 5 5600X 6x 3.70GHz So.AM4 BOX', 'Konzipiert, um Erwartungen zu übertreffen\r\nDer AMD Ryzen™ 5 5600X ist ein echter Preistipp unter den Alltags- und Gaming-Prozessoren, der auch in günstigen Gaming-Rechnern eine gute Figur abgibt. Der Prozessor verfügt über sechs Kerne mit Multithreading (12 Threads) zur parallelen Bearbeitung mehrerer Tasks. Die CPU taktet von 3,7 bis 4,6 Gigahertz und unterstützt DDR4-3200-RAM. Die L1- und L2-Caches sind im Vergleich zur Vorgängergeneration mehr oder weniger gleich geblieben, dafür hat sich beim L3-Cache etwas getan: Auf diesen greifen nun je nach Modell bis zu acht Kerne gleichzeitig zu. Dieses neue Cache-Modell verringert die Latenzen, was gerade dem Gaming zugutekommt.\r\n\r\nAMD Ryzen™ Prozessoren bieten die besten Features, um im Spiel zu bleiben.\r\nNeueste Technologien zur Unterstützung außergewöhnlicher Performance. Alle AMD Ryzen™ 5000 Prozessoren bieten eine vollständige Suite von Technologien, die für mehr Performance auf Ihrem PC sorgt - darunter Precision Boost 2, Precision Boost Overdrive und PCIe® 4.0.\r\n\r\nAMD Ryzen™ Prozessoren sind einfach konfigurierbar und anpassbar.\r\nFür einander geschaffen. Mainboards mit neuestem AMD 500 Chipsatz und AMD Ryzen 5000 Prozessoren. Optimieren Sie den neuen Ryzen™ 5000 mit Ryzen™ Master und AMD StoreMI.\r\n\r\nDie \"Zen 3\"-Architektur basiert auf dem neuen \"Unified Complex\"-Konzept, das bis zu acht Kerne und einen 32-MB-L3-Cache zu einer einzigen Ressourcengruppe vereint. Mehr Anweisungen pro Takt und geringere Latenzen sind insbesondere für PC-Spiele ein großer Vorteil. 19 % höhere Befehlsraten pro Zyklus und geringere Latenz kommen ganz ohne eine Erhöhung des Stromverbrauchs aus.\r\n\r\nWie alle RyzenTM-CPUs ist auch beim 5600X-Prozessor werksseitig der Multiplikator freigeschaltet. Mithilfe des AMD-RyzenTM-Master-Dienstprogramms kann die Leistung der CPU an individuelle Anforderungen angepasst werden.', 51, '224.00', '240.00', 199, '2022-04-13 07:01:14', '2022-05-25 13:17:22', 1),
(21, 'AMD Ryzen 9 5900X 12x 3.70GHz So.AM4 WOF', 'Konzipiert, um Erwartungen zu übertreffen\r\nDer AMD Ryzen™ 9 5900X besitzt 12 CPU-Kerne auf Basis der Zen-3-Architektur, der inzwischen vierten Zen-Generation. Im Vergleich zu den Vorgängern hat nun jeder Prozessorkern Zugriff auf den gesamten L3-Cache. 24 Threads und eine Taktfrequenz von bis zu 4.80 GHz bieten High-Performance bei Gaming, Streaming, Videobearbeitung oder 3D-Renderings. Alle AMD-Ryzen™-5000-Prozessoren, so auch der 5900er, bieten Technologien, die für mehr Performance auf Ihrem PC sorgen; unter anderem Precision Boost 2, Precision Boost Overdrive und PCIe® 4.0.\r\n\r\nAMD Ryzen™ Prozessoren bieten die besten Features, um im Spiel zu bleiben.\r\nNeueste Technologien zur Unterstützung außergewöhnlicher Performance. Alle AMD Ryzen™ 5000 Prozessoren bieten eine vollständige Suite von Technologien, die für mehr Performance auf Ihrem PC sorgt - darunter Precision Boost 2, Precision Boost Overdrive und PCIe® 4.0.\r\n\r\nAMD Ryzen™ Prozessoren sind einfach konfigurierbar und anpassbar.\r\nFür einander geschaffen. Mainboards mit neuestem AMD 500 Chipsatz und AMD Ryzen 5000 Prozessoren. Optimiere den neuen Ryzen™ 5000 mit Ryzen™ Master und AMD StoreMI.\r\n\r\nDer \"Zen 3\"-Architektur liegt das neue \"Unified Complex\"-Konzept zugrunde, das bis zu acht Kerne und einen 32-MB-L3-Cache zu einer einzigen Ressourcengruppe zusammenfügt. Mehr Anweisungen pro Takt und geringere Latenzen sind insbesondere für latenzkritische Anwendungen wie Spiele ein großer Vorteil.\r\n\r\nWie bei allen Ryzen™-CPUs ist auch beim 5600X-Prozessor werksseitig der Multiplikator freigeschaltet. Mithilfe des AMD-Ryzen™-Master-Dienstprogramms ist die Leistung des Prozessors individuell anpassbar.\r\n\r\nDank VR-Ready-Premium-Siegel können Sie mit diesem Prozessor voll und ganz in die virtuelle Welt abtauchen. Die geforderten Spezifikationen für Oculus Rift, HTC Vive oder Microsoft Windows® Mixed Reality werden dabei mühelos erreicht und sogar übertroffen.\r\n***ACHTUNG:****\r\nDie Verwendung der CPU ist nur in Verbindung der Mainboards mit AMD 500-Serie Chipset möglich. Bitte prüfen Sie die Kompatibilität auf der Herstellerseite.', 51, '409.00', '409.00', 199, '2022-04-13 07:02:40', '2022-05-25 13:11:08', 1),
(22, 'RAZER KRAKEN X, Over-ear Gaming Headset', 'RAZER KRAKEN X, Over-ear Gaming Headset Schwarz', 250, '49.99', '49.99', 197, '2022-04-13 07:02:59', '2022-05-25 13:36:07', 1),
(23, '1TB Samsung SSD 980 M.2 PCIe 3.0 x4 3D-NAND TLC (MZ-V8V1T0BW)', 'Schöpfen Sie das Potenzial Ihres PCs mit der Samsung SSD 980 aus. Egal, ob Sie einen Boost für Spiele oder einen nahtlosen Workflow für umfangreiche Grafiken benötigen, die 980 ist eine kluge Wahl für herausragende SSD-Leistung - und all das wird durch eine NVMe-Schnittstelle und PCIe 3.0-Technologie unterstützt. Halten Sie Ihre SSD mit dem Full-Power-Modus auf Hochtouren, der für kontinuierliche und zuverlässige Höchstleistung sorgt. Aktivieren Sie die Samsung Magician-Software, um Ihre SSD ohne Latenz im aktiven Modus zu halten, sodass Sie sofort wieder in große, intensive Arbeitsdateien oder grafikintensive Spiele zurückkehren können.', 53, '93.00', '104.00', 199, '2022-04-13 07:03:57', '2022-05-25 13:12:29', 1),
(24, 'AMD Ryzen 5 5600G 6x 3.90GHz So.AM4 BOX', 'Mit der Highspeed Gaming-Performance der AMD Ryzen™ 5000G Serie sind Sie selbst in den neuesten Games nicht mehr aufzuhalten. Auch Videobearbeitung und 3D Rendering meistern die Ryzen™ 5000G Prozessoren problemlos. Bis zu 8 Kerne, 16 Threads, Taktfrequenzen von bis zu 4,6 GHz und bis zu 16 MB Cache lassen Sie bahnbrechende Performance erleben. Die integrierte AMD Radeon™ Grafikeinheit führt Sie blitzschnell zum Sieg. Spielen Sie Top-Games in flüssigem 1080p direkt ab Werk oder holen Sie sich eine Grafikkarte für noch mehr Leistung.\r\n\r\nMit der Ryzen™ 5000G Serie gehören Hardware-Limits der Vergangenheit an. Mit neuesten Technologien wie Precision Boost 3 und Precision Boost Overdrive wird Ihnen Performance ohne gleichen geboten. Die 5000G-Serie bleibt auch unter Belastung kühl und folgt damit der Tradition der herausragenden Performance der 7nm-Architektur.\r\n\r\nMit einem einfachen BIOS-Update auf AMD 500 Mainboards sowie auf ausgewählten Boards der 400 Serie ist der AMD Ryzen™ 5000G sofort einsatzbereit. Das Konfigurieren Ihres Gaming-PCs wird damit zum Kinderspiel. Installieren Sie AMD StoreMI, um Ihre Festplatte mit der SSD zu kombinieren und Ihre Spiele noch schneller zu laden.\r\n', 51, '199.00', '230.00', 199, '2022-04-13 07:04:53', '2022-05-25 13:22:09', 1),
(25, 'HYPERX Cloud Stinger Gaming Headset', 'HYPERX Cloud Stinger Kabelloses Core Gaming Headset + 7.1 Over-ear Schwarz', 250, '74.99', '74.99', 199, '2022-04-13 07:05:03', '2022-05-25 13:23:05', 1),
(26, 'be quiet! Pure Base 500DX Midi Tower ohne Netzteil schwarz', '\r\nAirflow und Performance-optimierte Bauteile\r\n\r\nFür alle, die besonders viel Wert auf maximale Performance und wassergekühlte Systeme legen, ist das extrem luftdurchlässige Top-Cover die richtige Wahl.\r\nDie Staubschutzfilter am Frontpanel und am Boden sind zum Reinigen leicht zu entfernen.\r\n\r\nDREI VORINSTALLIERTE PURE WINGS 2\r\n\r\nFlüsterleiser Betrieb\r\nDrei vorinstallierte Pure Wings 2 Lüfter mit luftstromoptimierten Lüfterblättern versprechen einen perfekten Luftstrom und solide Kühlleistung. Trotz des kompakten Designs stellen die drei 140mm Lüfter einen geräuscharmen Betrieb sicher. Bis zu zwei weitere 140mm Lüfter können optional installiert werden.\r\n\r\nBEEINDRUCKENDE BELEUCHTUNG\r\n\r\nARGB-Licht an der Front und im Gehäuse\r\nARGB LEDs bieten mehrere Farben und Modi, um die Optik des Gehäuses sowohl von innen als auch von außen individuell abzustimmen. Die Beleuchtung kann optional mit dem Motherboard oder der ARGB-Steuerung synchronisiert werden.\r\n\r\nINTELLIGENTES I/O-PANEL\r\n\r\nHochmoderne Technologie für dein System\r\nDas Front I/O-Panel verfügt über einen modernen USB 3.1 Gen. 2 Type C Anschluss für den Einsatz modernster Hardware. Es gibt außerdem einen Schalter, um die LEDs im Innen- und Außenbereich einzustellen.\r\n\r\nAUSGEKLÜGELTES DESIGN\r\n\r\nReichlich Platz für High-End Komponenten\r\nDas Pure Base 500DX Black bietet einen großzügigen Innenraum um High-End Grafikkarten und Kühler von bis zu 190mm Höhe zu installieren. Lüfter oder Radiatoren bis zu 360mm können leicht an der Vorderseite installiert werden. Die Oberseite bietet Platz für Lüfter und Radiatoren mit einer Größe von bis zu 240mm.\r\n\r\nAUFFÄLLIGE FEATURES\r\n\r\nSowie eine durchdachte Kabelführung\r\nDas Pure Base 500DX bietet zahlreiche Möglichkeiten, um bis zu fünf SSDs zu installieren. Zwei SSDs können sichtbar im Innenraum installiert werden. Dank der durchdachten Kabelführung können ungewünschte Kabel leicht versteckt werden.\r\n\r\nFUNKTIONALES PSU-COVER\r\n\r\nHält den Innenraum übersichtlich\r\nDas PSU-Cover versteckt nicht nur das Netzteil und Kabel, sondern beinhaltet auch einen Doppel-HDD-Käfig. Durch die entkoppelte Installation werden Vibrationen reduziert und ein geräuscharmer Betrieb unterstützt. Um einen 360mm-Radiator an der Front installieren zu können, kann der Doppel-HDD-Käfig versetzt werden. Das Netzteil kann benutzerfreundlich von der Rückseite des Gehäuses installiert werden.\r\n\r\nTEMPERGLAS\r\n\r\nDie perfekte Sicht in den PC\r\nDas elegante, verglaste Seitenfenster bietet einen perfekten Einblick auf die Komponenten in Ihrem PC. Das Seitenfenster ist mit getöntem Temperglas ausgestattet und verfügt über geschwärzte Seitenrahmen.', 58, '97.00', '97.00', 198, '2022-04-13 07:06:42', '2022-05-25 13:23:05', 1),
(27, '1TB Samsung 970 Evo Plus M.2 2280 PCIe 3.0 x4 NVMe 1.3 3D-NAND TLC (MZ-V7S1T0BW)', 'Eine herausragende SSD\r\nSo wird hohe Leistung noch gesteigert. Die mit modernster V-NAND-Technologie ausgestattete 970 EVO Plus ist noch schneller als die 970 EVO und verfügt zudem über eine Firmware-Optimierung. Damit reizt sie das Potential der PCIe-Schnittstelle und des NVMe Protokolls für noch schnellere Zugriffszeiten voll aus. Bei einer Speicherkapazität von 2 TB beträgt die spezifizierte Gesamtschreibdatenmenge (TBW = Total Bytes Written) 1.200 TB TBW.\r\n\r\nLeistung auf dem nächsten Level\r\nMit bis zu 3.500 MB/s1 Lese- und bis zu 3.300 MB/s2 Schreibgeschwindigkeit ist die 970 EVO Plus bis zu 53%3 schneller als das Vorgängermodell 970 EVO. Die neueste Generation der V-NAND-Technologie sorgt für eine herausragende Leistung und verbesserte Energieeffizienz. Zusätzlich zeichnet sich die 970 EVO Plus durch optimierte Firmware, den bewährten Phoenix-Controller sowie die Intelligent TurboWrite-Technologie für die Beschleunigung von Schreibvorgängen aus.\r\n\r\nFlexibilität durch gutes Produktdesign\r\nDie 970 EVO Plus zeigt die Weiterentwicklung im Bereich der NVMe-SSDs. Neben einer hohen Performance bietet sie eine Speicherkapazität von bis zu 2 TB Speicherkapazität im kompakten M.2-Formfaktor (2280). Sie bietet damit viel Speicherplatz bei geringen Abmessungen und spart damit wertvollen Platz für andere Komponenten. Innovative Samsung-Technologien ermöglichen es Ihnen damit, den Freiraum zu haben, den sie benötigen um viel zu erreichen und noch mehr zu bewerkstelligen.\r\n\r\nUnbedingte Zuverlässigkeit\r\nHaben Sie noch mehr Vertrauen. Der bewährte Samsung Phoenix-Controller ist mit einer Schicht aus Nickel überzogen und das Laufwerksmodul der 970 EVO Plus mit einem dünnen Heat Spreader versehen, so dass die entstehende Wärme im Betrieb effektiv abgeführt wird. Darüber hinaus wacht die Dynamic Thermal Guard-Funktion ständig über das Laufwerk, so dass optimale Betriebstemperaturen eingehalten werden und die Performance konstant gehalten werden kann.\r\n\r\nSamsung Magician\r\nSo wird die Laufwerksverwaltung zum Kinderspiel. Die kostenlose Samsung Magician-Software hilft Ihnen dabei, immer ein Auge auf Ihre SSD zu haben. Die benutzerfreundliche Software-Lösung hält das Laufwerk mit Updates immer auf dem neuesten Stand, überwacht Statusparameter und optimiert für Sie die Leistungsfähigkeit.', 53, '112.00', '130.00', 196, '2022-04-13 07:10:36', '2022-05-25 13:22:09', 1),
(28, '1TB Samsung 980 Pro M.2 PCIe 4. 3D-NAND TLC (MZ-V8P1T0BW)', 'Bringen Sie Ihre PC-Leistung auf das nächste Level mit der 1000 GB Samsung 980 PRO PCIe 4.0 NVMe® M.2 SSD. Die 980 PRO bietet mit PCIe 4.0 eine doppelt so hohe Übertragungsrate wie PCIe Gen3 SSDs, bei gleichzeitiger Abwärtskompatibilität mit PCIe 3.0. Als NVMe® SSD verfügt die 980 PRO mit einer Lesegeschwindigkeit von bis zu 7.000 MB/s und einer Schreibgeschwindigkeit von bis zu 5.000 MB/s über herausragende Geschwindigkeiten.\r\n\r\nDie 980 PRO überzeugt mit hoher Performance und einer Speicherkapazität von 1000 GB im kompakten M.2-Formfaktor. Sie bietet damit viel Speicherplatz bei geringen Abmessungen und spart damit wertvollen Platz für andere Komponenten. Innovative Samsung-Technologien geben Ihnen den Freiraum, den sie benötigen um viel zu erreichen und noch mehr zu bewerkstelligen. Das macht die 980 PRO ideal für Ihr High-Performance System.\r\n\r\nDie 980 PRO ist mit einer Nickelschicht überzeugen und das Laufwerksmodul ist mit einem dünnen Heat Spreader versehen, sodass die entstehende Wärme im Betrieb effektiv abgeführt wird. Darüber hinaus wacht die Dynamic Thermal Guard-Funktion ständig über das Laufwerk, so dass optimale Betriebstemperaturen eingehalten werden und die Performance konstant gehalten werden kann.\r\n\r\nDie Samsung Magician-Software hilft Ihnen dabei, immer ein Auge auf Ihre SSD zu haben. So wird die Laufwerksverwaltung zum Kinderspiel. Die benutzerfreundliche Software-Lösung hält das Laufwerk mit Updates immer auf dem neuesten Stand, überwacht Statusparameter und optimiert für Sie die Leistungsfähigkeit.', 53, '138.00', '170.00', 197, '2022-04-13 07:11:38', '2022-05-25 13:23:05', 1),
