(37, '2TB Seagate Barracuda Compute ST2000DM008 256MB 3.5', 'Zuverlässige 3,5-Zoll-HDD von Seagate, 2 TB Kapazität, 256 MB Cache, 220 MB/s kontinuierliche Datenübertragungsrate, SATA-6G-Schnittstelle', 53, '45.00', '50.00', 199, '2022-04-13 07:23:15', '2022-05-25 13:11:08', 1),
(38, 'be quiet! Pure Rock 2 Black', 'Mit 150 W Kühlleistung deckt der Pure Rock 2 Black von be quiet!® alle Anforderungen für Multimedia- und Grafikanwendungen ab. Die 4 Heatpipes sind auf maximale Performance ausgelegt und leiten die Hitze des Prozessors in Rekordzeit an den Kühlkörper aus Aluminium. Für die nötige Luftzirkulation sorgt der PMW-Lüfter Pure Wings 2, der die Geräuschkulisse mit strömungsoptimierten Lüfterblättern auf ein Minimum reduziert.\r\n\r\nBeim Kauf des be quiet!® Pure Rock 2 Black können Sie nichts falsch machen: Dank seiner Größe ist der Kühler platzsparend und deshalb mit zahlreichen Gehäusen kompatibel. Auch Ihren RAM installieren Sie sorgenfrei, denn die asymmetrische Bauform bietet genügend Raum für die Speicherbänke. Zusätzlich zum Kühler bekommen Sie ein leicht verständliches Installationskit, mit dem die Montage auf der CPU - egal ob AMD oder Intel® - kein Problem darstellt.\r\n\r\nWenn der Pure Rock 2 Black von be quiet!® Sie nicht schon mit seinem Preis-Leistungs-Verhältnis überzeugt, dann sicherlich mit seiner Optik. Das gebürstete Aluminium mit schwarzem Finish und die hochwertigen Kappen machen den CPU-Kühler zu einem echten Hingucker. Dank schlichter Farbwahl integriert er sich problemlos in jedes System.', 52, '35.00', '41.00', 198, '2022-04-13 07:24:24', '2022-05-25 13:22:09', 1),
(39, 'be quiet! Dark Rock Pro 4 Tower Kühler', 'Der Dark Rock Pro 4 von be quiet!® steht für Kühlperformance der Superlative. Er liefert eine beeindruckende TDP von 250 W - mehr als genug für High-End-CPUs und übertaktete PC-Systeme. Die schnelle Wärmeableitung erfolgt über 7 Kupfer-Heatpipes und luftstromoptimierte Kühllamellen. Selbst unter Höchstauslastung sorgt der CPU-Kühler für niedrige Temperaturen und damit optimale Performance in allen Situationen.\r\n\r\nUm den höchsten Anforderungen gerecht zu werden, setzt be quiet!® beim Dark Rock Pro 4 auf zwei luftstromoptimierte Kühlkörper aus Aluminium mit einer speziellen Keramikpartikel-Beschichtung. Dabei sorgen Aussparungen für eine verbesserte RAM-Kompatibilität. Zum Einsatz kommen außerdem zwei Lüfter, die eine schnelle Luftzirkulation ermöglichen. Einen dritten Lüfter können Sie bei Bedarf nachrüsten. Abgerundet wird das Design von einer Abdeckung aus gebürstetem Aluminium im edlen Diamond-Cut.\r\n\r\nIn gewohnter be quiet!®-Manier setzt der Hersteller auch beim Dark Rock Pro 4 auf einen möglichst leisen Betrieb. Selbst unter Volllast erreicht der CPU-Kühler nur 24,3 db(A). Zu verdanken ist das den Silent-Wings-PWM-Lüftern mit laufruhigen Motoren und langlebigen Fluid-Dynamic-Lagern, die vibrationsisolierend montiert werden. Über die Steuerung können Sie die Lüfterkurve anpassen und so die Systemtemperaturen und die Lautstärke Ihres Systems optimieren.\r\n\r\n', 52, '74.00', '87.00', 195, '2022-04-13 07:26:11', '2022-05-25 13:25:46', 1),
(40, '500GB Samsung 970 Evo Plus M.2 2280 PCIe 3.0 x4 NVMe 1.3 3D-NAND TLC (MZ-V7S500BW)', 'Eine herausragende SSD\r\nSo wird hohe Leistung noch gesteigert. Die mit modernster V-NAND-Technologie ausgestattete 970 EVO Plus ist noch schneller als die 970 EVO und verfügt zudem über eine Firmware-Optimierung. Damit reizt sie das Potential der PCIe-Schnittstelle und des NVMe Protokolls für noch schnellere Zugriffszeiten voll aus. Bei einer Speicherkapazität von 2 TB beträgt die spezifizierte Gesamtschreibdatenmenge (TBW = Total Bytes Written) 1.200 TB TBW.\r\n\r\nLeistung auf dem nächsten Level\r\nMit bis zu 3.500 MB/s1 Lese- und bis zu 3.300 MB/s2 Schreibgeschwindigkeit ist die 970 EVO Plus bis zu 53%3 schneller als das Vorgängermodell 970 EVO. Die neueste Generation der V-NAND-Technologie sorgt für eine herausragende Leistung und verbesserte Energieeffizienz. Zusätzlich zeichnet sich die 970 EVO Plus durch optimierte Firmware, den bewährten Phoenix-Controller sowie die Intelligent TurboWrite-Technologie für die Beschleunigung von Schreibvorgängen aus.\r\n\r\nFlexibilität durch gutes Produktdesign\r\nDie 970 EVO Plus zeigt die Weiterentwicklung im Bereich der NVMe-SSDs. Neben einer hohen Performance bietet sie eine Speicherkapazität von bis zu 2 TB Speicherkapazität im kompakten M.2-Formfaktor (2280). Sie bietet damit viel Speicherplatz bei geringen Abmessungen und spart damit wertvollen Platz für andere Komponenten. Innovative Samsung-Technologien ermöglichen es Ihnen damit, den Freiraum zu haben, den sie benötigen um viel zu erreichen und noch mehr zu bewerkstelligen.\r\n\r\nUnbedingte Zuverlässigkeit\r\nHaben Sie noch mehr Vertrauen. Der bewährte Samsung Phoenix-Controller ist mit einer Schicht aus Nickel überzogen und das Laufwerksmodul der 970 EVO Plus mit einem dünnen Heat Spreader versehen, so dass die entstehende Wärme im Betrieb effektiv abgeführt wird. Darüber hinaus wacht die Dynamic Thermal Guard-Funktion ständig über das Laufwerk, so dass optimale Betriebstemperaturen eingehalten werden und die Performance konstant gehalten werden kann.\r\n\r\nSamsung Magician\r\nSo wird die Laufwerksverwaltung zum Kinderspiel. Die kostenlose Samsung Magician-Software hilft Ihnen dabei, immer ein Auge auf Ihre SSD zu haben. Die benutzerfreundliche Software-Lösung hält das Laufwerk mit Updates immer auf dem neuesten Stand, überwacht Statusparameter und optimiert für Sie die Leistungsfähigkeit.', 53, '66.00', '66.00', 199, '2022-04-13 07:27:32', '2022-05-25 13:17:22', 1),
(41, '18TB Toshiba Enterprise Capacity MG09ACA 512e SATA 6Gb/s', 'Toshiba MG09. HDD Größe: 3.5 Zoll, HDD Kapazität: 18000 GB, HDD Geschwindigkeit: 7200 RPM', 53, '283.00', '283.00', 198, '2022-04-13 07:28:42', '2022-05-25 13:23:05', 1),
(42, '4TB WD Red Plus WD40EFZX 128MB 3.5\" (8.9cm) SATA 6Gb/', 'Schnelle 3,5 Zoll Festplatte mit 4 TB, mit NAS-Technologie und 128 MB Cache, NASware 3.0 und 3D Active Balance Plus-Technologie, heliumgefüllt für maximale Kapazität & Effizienz im Dauerbetrieb, optimiert für NAS- und RAID-Systeme', 53, '89.00', '96.00', 89, '2022-04-13 07:29:58', '2022-05-25 13:25:46', 1),
(43, 'NZXT H710 Midi Tower ohne Netzteil schwarz/rot', 'NEUE FUNKTIONEN: Front-I / O-USB-Typ-C-Anschluss und Seitenwand aus gehärtetem Glas mit Einzelschraubenmontage\r\nMODERNER: Mit einem USB 3.1 Gen 2-kompatiblen USB-C-Anschluss an der Vorderseite ist es einfacher denn je, die neuesten Smartphones, externen Hochgeschwindigkeitsspeicher oder die neuesten Peripheriegeräte an Ihren PC anzuschließen\r\nNOCH SCHÖN: Das klare, moderne Design, die kultige Kabelführungsleiste und die durchgehende Seitenverkleidung aus gehärtetem Glas unterstreichen Ihre beeindruckende Bauweise.\r\nVERBESSERTE KABELVERWALTUNG: Unser patentiertes Kabelverlegungskit mit vorinstallierten Kanälen und Bändern macht die Verkabelung einfach und intuitiv und einfach\r\nSTREAMLINED-KÜHLUNG: Zwei F120-mm-Aer-Lüfter * sorgen für eine optimale Luftzirkulation. Die Frontplatte und die Netzteileinlässe enthalten abnehmbare Filter und eine abnehmbare Halterung für Heizkörper mit bis zu 240 mm Durchmesser', 58, '140.00', '140.00', 199, '2022-04-13 07:34:37', '2022-05-25 13:17:22', 1),
