(47, 'Microsoft Windows 10 Pro 64 Bit Deutsch DSP/SB', 'Seit dem 03.07.2015 im Sortiment\r\n\r\nMicrosoft Windows 10 Pro (64 Bit) in der deutschen DSP/SB-Version auf einer guten alten DVD als Installationsmedium\r\n\r\nTechnische Details:\r\n\r\nVersion: Microsoft Windows 10 Pro 64 Bit, DSP/SB - DVD (deutsch)\r\nSystemvoraussetzungen\r\nProzessor: 1 GHz oder schneller\r\nRAM: 2 GB\r\nFestplattenspeicher: 20 GB\r\nGrafikkarte: Microsoft DirectX 9-Grafikkarte mit WDDM-2.0-Treiber', 8, '128.00', '300.00', 195, '2022-04-25 09:50:12', '2022-05-25 13:23:05', 1),
(48, 'Iceberg Thermal IceSleet G4 OC Black - AM4/Intel (ICESLEETG4OC-BBT-00A', 'Der Iceberg Thermal IceSleet G4 OC wurde für den Mainstream-Gamer entwickelt, der nach der perfekten Mischung aus Qualität, Handwerkskunst und Leistung strebt.\r\n\r\nDie innovative Fan-Slide-Lock Technologie wurde entwickelt, damit Sie sich nicht mehr mit Clips herumschlagen müssen, um Ihren Lüfter am Kühlkörper zu befestigen. Schieben Sie einfach Ihren Lüfter nach unten und Sie können loslegen! Es ist nicht nur einfach, es verbessert auch die RAM-Freigabe.\r\n\r\nDie Ventilatoren sind für die Ewigkeit gebaut. Die Lüfter der Kühler haben TRUE Fluid Dynamic Bearing und sind auf zwei Ebenen ausbalanciert, sodass die Lebensdauer Ihrer Lüfter erheblich verlängert wird. Selbst bei einem Luftstrom von 58,5 CFM hat unser Lüfter mit 600-1400 U/min einen maximalen Geräuschpegel von 22,5 dBA.\r\n\r\nDie Kühler verfügen über 4 symmetrisch abgestimmte und vollständig vernickelte Kühler für ein elegantes Finish dieses sorgfältig gestalteten CPU-Kühlers. Mit einem TDP-Bereich von 140 W bis 180 W ist der G4 OverClock flexibel für Ihre zukünftigen PC-Upgrades.\r\n\r\nMit der ARGB-Funktion können Sie die Farben anpassen, die Sie auf Ihrem CPU-Kühler haben möchten. Der Kühler ist ausgestattet mit 16 ARGB-LEDs, um einen nahtlosen Lichteffekt zu ermöglichen.\r\n\r\n\r\nIceberg Thermal IceSLEET G4 OC. Typ: Kühler, Lüfterdurchmesser: 12 cm, Rotationsgeschwindigkeit (min.): 600 RPM, Rotationsgeschwindigkeit (max.): 1400 RPM, Geräuschpegel (hohe Geschwindigkeit): 22,5 dB, Maximaler Luftstrom: 58,5 cfm, Maximum Luftdruck: 1,5 mmH2O, Lagertyp: Fluid Dynamic Bearing (FDB). Spannung: 5 - 12 V. Breite: 139 mm, Tiefe: 81 mm, Höhe: 156 mm. Produktfarbe: Schwarz', 52, '54.00', '54.00', 199, '2022-04-25 09:54:24', '2022-05-25 13:17:22', 1),
(49, '12GB KFA2 GeForce RTX 3080 Ti SG (1-Click OC) Aktiv PCIe 4.0 x16', 'Die GeForce RTX™ 3080 Ti-GPUs werden von der NVIDIA® Ampere-Architektur angetrieben und bieten einen unglaublichen Sprung in Leistung und Wiedergabetreue mit gefeierten Funktionen wie Raytracing, NVIDIA® DLSS leistungssteigernder KI, NVIDIA® Reflex-Latenzreduzierung, NVIDIA® Broadcast-Streaming-Funktionen und zusätzlichem Speicher. Dies ermöglicht es, auch die beliebtesten Creator-Anwendungen optimal auszuführen.\r\n\r\nDer neue Lüfter-Stopp-Mechanismus überwacht sowohl die GPU- als auch die Speichertemperatur und schaltet die Lüfter intelligent ein und aus, um die perfekte Balance zwischen Geräusch und Leistung zu erzielen. Die Lüfter verfügen über elf innovative Flügellüfterblätter, die nicht nur durch ihr gutes Aussehen überzeugen, sondern auch einen hohen Luftdurchsatz und Luftdruck bei minimalem Geräuschpegel ermöglichen.\r\n\r\nPersonalisieren Sie Ihre RGB-Beleuchtung mit Xtreme Tuner oder synchronisieren Sie die Beleuchtung mit dem Rest Ihrer Komponenten.\r\n\r\n', 54, '1300.00', '1400.00', 197, '2022-04-25 09:56:37', '2022-05-25 13:18:46', 1),
