(52, 'Corsair iCUE QL140 (CO-9050105-WW) RGB LED PWM Single Fan weiss', 'Corsair iCUE QL140. Typ: Ventilator, Lüfterdurchmesser: 14 cm, Rotationsgeschwindigkeit (min.): 550 RPM, Rotationsgeschwindigkeit (max.): 1250 RPM, Geräuschpegel (hohe Geschwindigkeit): 26 dB, Maximaler Luftstrom: 50,2 cfm, Maximum Luftdruck: 1,4 mmH2O, Lagertyp: Hydraulisch. Spannung: 6 - 13.2 V. Produktfarbe: Weiß', 59, '35.50', '35.50', 198, '2022-04-25 11:21:50', '2022-05-25 13:12:29', 1),
