(63, '650 Watt NZXT C Series C650 Modular 80+ Gold', 'NZXT C Series Modulare Netzteile\r\nDas neue Netzteil der C-Serie von NZXT bietet eine betriebssichere und zuverlässige Spannungsversorgung bei optimaler Effizienz und geräuscharmer Leistung. Das Netzteil der C-Serie besteht aus hochwertigen Komponenten und wird mit einer 10-jährigen Garantie ausgeliefert. Es bietet sowohl Sorgenfreiheit als auch saubere, zuverlässige Betriebsspannung für Ihr PC-Gaming-System.', 57, '83.00', '83.00', 198, '2022-04-27 10:16:01', '2022-05-25 13:22:09', 1),
