(68, '6GB MSI GeForce RTX 2060 VENTUS GP OC GDDR6 3xDP HDMI 2.0b (Retail)', 'Als frisches neues Design mit zwei Lüftern präsentiert MSI mit der VENTUS-Serie stolz industrielle Formen in neutralen Farben, die zu jedem Build passen.', 54, '338.00', '338.00', 192, '2022-05-24 22:20:52', '2022-05-25 13:47:26', 1),
(69, 'ASUS DRW-24D5MT intern DVD-Brenner', 'Sie kennen das: Man möchte unbedingt noch etwas aus dem Internet herunterladen, doch es fehlt an Festplattenkapazität. Mit einem DVD-Brenner wie dem DRW-24D5MT von ASUS können Sie Ihre Festplatte ordentlich aufräumen und Ihre Daten auf einer DVD archivieren.', 55, '17.99', '17.99', 199, '2022-05-24 22:24:58', '2022-05-25 13:12:29', 1),
