(71, 'MSI MPG X570 GAMING PRO CARBON WIFI AMD X570 So.AM4 Dual Channel DDR4 ATX Retail', 'Kompatibel mit AMD Ryzen 9, Ryzen 7 und Ryzen 5 AM4 Prozessoren der 3. Generation\r\nPCIe und M.2 Lightning Gen4 für schnelle Datenübertragungen\r\nWLAN 6 (802.11ax) Technik mit MU-MIMO für problemfreies Online-Gaming\r\nFrozr-Kühlkörper mit patentiertem Lüfter und Doppelkugellager für optimale Kühlleistung\r\nDie vorinstallierte I/O-Blende bietet mehr Schutz vor elektromagnetischer Interferenzen und mehr Komfort beim Einbau des Motherboards.', 56, '220.48', '220.48', 195, '2022-05-24 22:27:41', '2022-05-25 13:23:05', 1),
(72, 'ASUS ROG MAXIMUS Z690 EXTREME E-ATX Mainboard Sockel 1700', 'Das ROG Maximus Z690 Extreme ist das ultimative Enthusiasten-Mainboard für alle, die sowohl bei der Luft- als auch bei der Flüssigkeitskühlung für Intel® Core™ CPUs der 12. die maximale Leistung erwarten. Diese Plattform ist vollgepackt mit den unzähligen Funktionen, darunter hochbelastbare 24+1 Leistungsstufen, ASUS Enhanced Memory Profiles für erstklassige DDR5-Geschwindigkeiten, mehrere PCIe 5.0-Steckplätze und das exklusive AniMe Matrix™ LED-Display.', 56, '1154.81', '1154.81', 199, '2022-05-24 22:28:36', '2022-05-25 13:18:46', 1),
(73, '850 Watt be quiet! Straight Power 11 Modular 80+ Gold', 'Das be quiet! Straight Power 11 850W setzt neue Maßstäbe für flüsterleise Systeme, ohne auch nur geringste Kompromisse bei der Stromversorgung einzugehen.', 57, '128.00', '128.00', 192, '2022-05-24 22:29:58', '2022-05-25 13:25:46', 1),
