(85, 'Windows Server 2016 Standard', 'Mit der Verfügbarkeit der Software Windows Server 2016 bremst Microsoft den Weg in Richtung Cloud Anwendungen und Virtualisierung. Die Entwicklung erfolgte parallel mit Windows 10. Neben zahlreichen Verbesserungen und neuen Funktionen änderte der Hersteller jedoch sein Lizenzmodell. Geblieben sind die in allen zurückliegenden Serverversionen viel zu niedrigen Mindestanforderungen. Microsoft wendet sich mit dieser Serversoftware an Unternehmen, Dienstleister und Freiberufler, die im Idealfall das Desktop Betriebssystem Windows 10 im Einsatz haben. Kaufversionen der Software stehen online als Download in vollem Umfang sofort zur Verfügung.', 8, '109.95', '109.95', 198, '2022-05-25 02:10:49', '2022-05-25 13:25:46', 1),
(86, 'be quiet! Thermal Grease Waermeleitpaste 3g', 'Für den bestmöglichen Schutz wertvoller Hochleistungsprozessoren und Grafikkarten ist die perfekte Kühlung der Komponenten eine der wichtigsten Voraussetzungen. Und was wäre neben der Entscheidung für einen erstklassigen CPU-Kühler, wie beispielsweise dem Dark Rock 2, die perfekte Ergänzung? DC1 natürlich - be quiet!\'s neue high-performance Wärmeleitpaste für besonders anspruchsvolle Anwendungen im Kühlungsbereich.\r\n\r\n', 7, '4.73', '4.73', 198, '2022-05-25 02:59:18', '2022-05-25 13:23:05', 1),
(87, 'Arctic Silver 5 High-Density Polysynthetic Silver Thermal Compound Wärmeleitpaste', 'Arctic Silver 5 wurde nochmals verbessert und ist die ultimative Wärmeleitpaste für High End Anwendungen. Die reduzierte Partikelgröße der Silber-Wärmeleitkomponente und die verbesserte Zusammensetzung des polysynthetischen Trägermediums sorgen für eine noch bessere Verteilung der Paste und somit für eine noch bessere Wärmeübertragung. Arctic Silver 5 ist für alle Anwendungen geeignet.', 7, '22.49', '22.49', 199, '2022-05-25 03:00:49', '2022-05-25 13:25:46', 1),
