(91, 'ASUS XG49VQ 49 Zoll Gaming Monitor (4 ms Reaktionszeit, 144Hz)', 'Sie sind auf der Suche nach einem Monitor, der mit hervorragender Qualität, smarten Funktionen und einem schicken Design überzeugt? Dann liegen Sie mit dem XG49VQ von ASUS genau richtig! Seine geschmackvolle schwarze Farbe verleiht ihm einen Hauch Eleganz und lenkt die Blicke gekonnt auf das schicke Produkt.', 104, '859.99', '859.99', 199, '2022-05-25 03:14:16', '2022-05-25 13:12:29', 1),
(92, 'Logitech MX Master 2S Kabellose Maus Graphit', 'Die Logitech MX MASTER 2S ist die ultimative Präzisionsmaus für Poweruser. Nutzen Sie die Möglichkeiten von Logitech FLOW und verschieben Sie reibungslos Inhalte zwischen drei Computern. Das Scrollrad mit Geschwindigkeitsanpassung erlaubt ein schnelleres und einfacheres Scrollen durch Dokumente oder Webseiten. Arbeiten Sie dank der kompakten handgerechten Form und des ausdauernden Akkus stundenlang komfortabel.', 150, '64.90', '64.90', 198, '2022-05-25 03:15:33', '2022-05-25 13:25:46', 1),
(93, 'Logitech Optical Mouse B100', 'Geräteschnittstelle: USB\r\nÜbertragungstechnik: verkabelt\r\nEnergiequelle: Kabel\r\nBewegungerfassungs Technologie: Optisch\r\nZweck: Büro\r\nProduktfarbe: Schwarz\r\nFormfaktor: Ambidextrös\r\nOberflächen-Coloration: Monoton\r\nKabellänge: 1,8m\r\nKompatible Betriebssysteme: Microsoft Windows XP, Windows Vista, Windows 7, Linux 2.4 +, Mac OS X 10.3.9 +\r\nAnzahl der enthaltenen Produkte: 1 Stück', 150, '8.90', '8.90', 198, '2022-05-25 03:16:34', '2022-05-25 13:25:21', 1),
(94, 'RAZER DeathAdder Essential Gaming Maus, Schwarz', 'Optischer Sensor mit echten 6.400 DPI\r\nDie Razer DeathAdder Essential verfügt über einen bewährten optischen Sensor mit echten 6.400 DPI für schnelle und präzise Mausbewegungen. So bleibt selbst in der Hitze des Gefechts alles unter Kontrolle.\r\n\r\nErgonomische Form\r\nOptimale Performance selbst bei den längsten Gaming-Marathons. Dank ihrer ergonomischen Form liegt die Maus stets bequem in der Hand, damit auch bei langen Gaming-Sessions in der Hitze des Gefechts noch alles unter Kontrolle bleibt.\r\n\r\nExtra robust\r\nDie Razer DeathAdder Essential ist extra robust, um gerade bei intensiven Gaming-Sessions eine optimale Performance zu ermöglichen. Ihre 5 Hyperesponse-Tasten wurden im Labor auf bis zu 10 Millionen Klicks getestet, damit diese Maus auch garantiert bis zum Ende durchhält.', 151, '24.99', '24.99', 199, '2022-05-25 03:27:02', '2022-05-25 13:17:22', 1),
(95, 'RAZER Basilisk X Hyperspeed Gaming Maus, Schwarz', 'Spiele kabellos mit einer ebenso schnellen wie zuverlässigen Verbindung — mit Razer™ HyperSpeed Dual-Modus-Konnektivität: kabellos und per Bluetooth. Der Optische Razer™ Focus+ Sensor bietet dir 16.000 DPI für präzise Mausbewegungen und die Mechanischen Maus-Switches von Razer™ halten bis zu 50 Millionen Klicks durch.', 151, '49.99', '49.99', 198, '2022-05-25 03:28:07', '2022-05-25 13:38:50', 1),
(96, 'Logitech G733 LIGHTSPEED Kabelloses Gaming Headset schwarz', 'Kabellose LIGHTSPEED-Technologie – Absolute Freiheit mit einer Reichweite von bis zu 20 m und kabelloser LIGHTSPEED-Audioübertragung. Spiele mit bis zu 29 Stunden Akkulaufzeit. * Spiele auf PlayStation® 4 in Stereo. ', 250, '126.90', '126.90', 198, '2022-05-25 03:55:30', '2022-05-25 13:15:09', 1),
(97, 'Shure Beta 58 A Mikrofon', 'Das Beta 58A ist ein dynamisches Gesangsmikrofon mit hoher Ausgangsleistung, das für professionelle Audioverstärkung und den Einsatz im Tonstudio entwickelt wurde. Die Supernierencharakteristik erstreckt sich über den gesamten Übertragungsbereich und garantiert hohe, rückkopplungsfeste Verstärkungen, maximale Isolierung von anderen Schallquellen und ein Minimum an außeraxialen Verfärbungen. Der konturierte Frequenzgang eignet sich hervorragend für die Nahaufnahme von Gesangsstimmen.', 252, '159.00', '159.00', 197, '2022-05-25 03:57:40', '2022-05-25 13:36:07', 1),
