(103, 'CINEBAR ONE', 'Die CINEBAR ONE ist eine auf das Beste reduzierte Soundbar, die schon beim ersten Ton über sich hinaus wächst. Dank Dynamore Ultra erlebst du virtuellen Surround Sound – am TV-Gerät, PC oder Notebook, im Schlafzimmer, Kinderzimmer oder Homeoffice.', 254, '249.99', '249.99', 199, '2022-05-25 04:33:56', '2022-05-25 13:11:08', 1),
