(107, 'ASUS Strix Soar, Soundkarte', 'Heimkino-Blockbuster und Wohnzimmer-Konzerte erreichen dank der Soundkarte von ASUS neue Höhepunkte: Die Karte sorgt für einen klaren und detailreichen Sound und somit für herausragende Klangerlebnisse.\r\n\r\nDie Soundkarte besitzt gleich mehrere Audioeingänge: 1x Klinke (3.5mm)(analog). Das Gerät können Sie intern mit Ihrem Computer verbinden. Zusätzlich stehen Ihnen mehrere Anschlüsse zur Verfügung (1x Kopfhörer-Ausgang, 1x Line-Eingang, 1x Line-OUT, 1x PCI-E und 1x S/PDIF-Ausgang).\r\n\r\nQualität, die man hört: Die Soundkarte 90YB00J0-M1UA00 STRIX SOAR bringt den Sound von Ihrem Computer auf eine neue Ebene.', 255, '87.99', '87.99', 199, '2022-05-25 05:05:54', '2022-05-25 13:23:05', 1),
(108, 'CREATIVE SB Z Soundkarte SE', 'LASKLARER KLANG – Freuen Sie sich auf eine beeindruckende Audioqualität mit bis zu 116 dB SNR bei einer Bitrate von bis zu 24 Bit / 192 kHz. Die Soundkarte verfügt außerdem über vergoldete Anschlüsse, eine Lautsprecher-Optimierungstechnik und Kodiermöglichkeiten für digitale Inhalte für beste digitale Audioleistung. In Verbindung mit der ASIO-Unterstützung (Audio Stream Input/Output) liefert der Sound Blaster Z SE Audiosignale mit niedriger Latenz und hoher Klangtreue, auch bei Audioaufnahmen', 255, '89.10', '89.10', 198, '2022-05-25 05:15:39', '2022-05-25 13:36:42', 1),
