(120, 'NETGEAR Nighthawk RAX200 - Wireless Router - 5-Port-Switch - GigE, 2.5 GigE - 802.11a/b/g/n/ac/ax - Tri-Band', 'AX11000 Nighthawk AX12/12-Stream Tri-Band WLAN 6 Router, Quad-Core 1.8GHz Processor, Multi-Gig 2.5G/1G ETH Port, 1024-QAM, 2x USB-3.0-Ports, Port-Aggregation, 64-bit 1.8GHz Quad-core Prozessor für 4K/8K UHD Streaming & Gaming ideal für Gigabit Internet Geschwindigkeiten', 203, '545.42', '545.42', 199, '2022-05-25 06:28:04', '2022-05-25 13:17:22', 1),
(121, 'AVM FRITZ!WLAN Mesh Repeater 600', 'AVM FRITZ!WLAN Mesh Repeater 600 (WLAN N bis zu 600 MBit/s (2,4 GHz), WPS, kompakte Bauweise, deutschsprachige Version)', 204, '32.99', '32.99', 199, '2022-05-25 06:28:59', '2022-05-25 13:23:05', 1),
(122, 'TP-LINK TL-WA850RE 300MBit/s WLAN Repeater', 'Der WLAN-Repeater TL-WA850RE macht Schluss mit Funklöchern. Mit einer Geschwindigkeit von bis zu 300 Mbit/s verlängert er das WLAN-Signal einwandfrei in bisher unerreichte oder schwer zu verkabelnde Bereiche und sorgt für einen stabilen Empfang für Computer, Laptops, Smartphones und Mediaplayer.\r\n\r\nDie Inbetriebnahme das TL-WA850RE ist kinderleicht: Um den Repeater mit dem Router zu verbinden, drücken Sie zunächst die WPS-Taste am Router gefolgt von der WPS-Taste (RE) am Repeater. Das war\'s! Anschließend können Sie den Repeater innerhalb der WLAN-Reichweite in jede beliebige Steckdose einstecken, ohne weitere Einstellungen vornehmen zu müssen.\r\n\r\nÜber den LAN-Port des TL-WA850RE können kabelgebundene Netzwerkgeräte ohne eigene WLAN-Funktion wie Blue-ray Player, Spielekonsolen und Smart TVs in das vorhandene WLAN eingebunden werden.\r\n\r\nDie intelligenten Signalleuchten zeigen die aktuell durch den TL-WA850RE empfangene Signalstärke an. So können Sie ganz einfach den besten Betriebsort finden.\r\n\r\nFür eine optimale Signalstärke wird empfohlen, den Repeater an einer Stelle anzubringen, an der 3-4 LEDs leuchten.\r\n\r\nDer Gigabit-Ethernet-Port des RE650 bietet einen superschnellen Kabelzugang für Desktop-PCs, Smart-TVs und Spielekonsolen\r\n\r\nDurch die intelligente Signalstärkeanzeige ist der optimale Betriebsort Ihres RE650 schnell gefunden.\r\n\r\nDer RE650 ist mehr als nur ein einfacher Repeater. Bei vorhandenem Kabelzugang dient das Gerät auch als MU-MIMO-Dualband-WLAN-Accesspoint.\r\n\r\nFällt ein Band des Routers aus, bietet der RE650 an seinem Standort weiterhin ein Dualband-WLAN an, um die Endgeräte zu versorgen. So können Sie durchgehend unbeschwert unterbrechungsfreie Verbindungen genießen.', 204, '19.99', '19.99', 199, '2022-05-25 06:29:44', '2022-05-25 13:37:27', 1),
(123, 'TP-LINK TL-WA860RE 300MBit/s mit Steckdose WLAN Repeater', '\r\nKombinationen\r\nEmpfohlene Kombinationen\r\nUnsere Top-Empfehlung\r\nTP-LINK TP-LINK TL-WA860RE 300MBit/s mit Steckdose WLAN Repeater\r\nTP-LINK TL-WA860RE 300MBit/s mit Steckdose WLAN Repeater\r\n\r\nUVP 29.99Der hier angezeigte Stattpreis ist die unverbindliche Preisempfehlung des Herstellers.UVP 29.99\r\n23.9923.99\r\nSERVICE Ready2Go@home Wifi Booster: Optimierung der WLAN- und Internetperformance\r\nReady2Go@home Wifi Booster: Optimierung der WLAN- und Internetperformance\r\n\r\n\r\nDetails anzeigen\r\n99.–99\r\n\r\nAlternativen\r\n122.99122.99\r\n\r\ninkl. MwSt. zzgl. Versand\r\nIn den Warenkorb\r\nTP-LINK TP-LINK TL-WA860RE 300MBit/s mit Steckdose WLAN Repeater\r\nTP-LINK TL-WA860RE 300MBit/s mit Steckdose WLAN Repeater\r\n\r\nUVP 29.99Der hier angezeigte Stattpreis ist die unverbindliche Preisempfehlung des Herstellers.UVP 29.99\r\n23.9923.99\r\nHAMA HAMA CAT-5e, Netzwerkkabel, 20 m\r\nHAMA CAT-5e, Netzwerkkabel, 20 m\r\n\r\n24.9924.99\r\n\r\nAlternativen\r\n48.9848.98\r\n\r\ninkl. MwSt. zzgl. Versand\r\nIn den Warenkorb\r\nTP-LINK TP-LINK TL-WA860RE 300MBit/s mit Steckdose WLAN Repeater\r\nTP-LINK TL-WA860RE 300MBit/s mit Steckdose WLAN Repeater\r\n\r\nUVP 29.99Der hier angezeigte Stattpreis ist die unverbindliche Preisempfehlung des Herstellers.UVP 29.99\r\n23.9923.99\r\nTP-LINK TP-LINK TL-WA850RE 300MBit/s WLAN Repeater\r\nTP-LINK TL-WA850RE 300MBit/s WLAN Repeater\r\n\r\nUVP 22.99Der hier angezeigte Stattpreis ist die unverbindliche Preisempfehlung des Herstellers.UVP 22.99\r\n19.9919.99\r\n\r\nAlternativen\r\n43.9843.98\r\n\r\ninkl. MwSt. zzgl. Versand\r\nIn den Warenkorb\r\nWeitere Pakete anzeigen\r\nProduktbeschreibung\r\nSie wünschen sich vollen WLAN-Empfang im ganzen Haus? Der WLAN-Repeater TL-WA860RE macht Schluss mit Funklöchern. Mit zwei externen Antennen verlängert er das WLAN-Signal einwandfrei in bisher unerreichte oder schwer zu verkabelnde Bereiche und sorgt für einen stabilen Empfang für Computer, Laptops, Smartphones und Mediaplayer.\r\n\r\nDie Inbetriebnahme das TL-WA860RE ist kinderleicht und erfordert keinerlei Konfiguration. Um den Repeater mit dem Router zu verbinden, drücken Sie zunächst die WPS-Taste am Router gefolgt von der WPS-Taste am Repeater. Das war\'s!\r\n\r\nDas kleine Gehäuse zum praktischen Einstecken in die Steckdose erlaubt eine einfache und flexible Installation. Die integrierte Steckdose sorgt dafür, dass Ihnen kein Steckplatz verloren geht.\r\n\r\nDie intelligenten Signalleuchten zeigen die aktuell durch den TL-WA860RE empfangene Signalstärke. So können Sie ganz einfach den besten Betriebsort finden.\r\n\r\nÜber den LAN-Port des TL-WA860RE können kabelgebundene Netzwerkgeräte ohne eigene WLAN-Funktion wie Blue-ray Player, Spielekonsolen und Smart TVs in das vorhandene WLAN eingebunden werden.', 204, '23.99', '23.99', 198, '2022-05-25 06:31:12', '2022-05-25 13:37:57', 1),
(124, 'CSL - RGB Gaming Mauspad', 'CSL - RGB Gaming Mauspad - LED Schreibtischunterlage - 800x300 mm - XXL Mousepad - LED Multi Color - 11 Beleuchtungs-Modi - 7 LED Farben Plus 4 Effektmodi - abwaschbar - schwarz', 152, '15.99', '15.99', 197, '2022-05-25 06:32:16', '2022-05-25 13:12:29', 1),
(125, 'ROCCAT ROC-13-181 SENSE CORE XXL Mauspad', 'Produkttyp	Mauspad\r\nMaterial	Polyester\r\nGewicht (laut Hersteller)	k. A.\r\nFarbe (laut Hersteller)	Schwarz\r\nFarbe (normiert)	Schwarz\r\nLieferumfang	Mauspad\r\nHersteller Artikelnummer	ROC-13-181', 152, '19.99', '19.99', 198, '2022-05-25 06:52:45', '2022-05-25 13:22:10', 1),
(126, 'Logitech K120 Kabelgebundene Business Tastatur für Windows und Linux', 'Logitech K120 Kabelgebundene Business Tastatur für Windows und Linux, USB-Anschluss, Leises Tippen, Robust, Spritzwassergeschützt, Tastaturaufsteller, Russisches Layout - schwarz', 153, '13.99', '13.99', 199, '2022-05-25 06:57:35', '2022-05-25 13:25:21', 1),
(127, 'Fujitsu S26381-K955-L420 Tastaturen, Einfarbig, Schwarz', 'Die KB955 ist eine ultraflache Tastatur mit extra flachen Tasten und Spritzwasserschutz. Das elegante Design und die hochwertige Verarbeitung machen die KB955 zum idealen Eingabegerät für jeden PC- oder Notebook-Nutzer. Sollten Sie versehentlich Wasser oder Kaffee auf die Tastatur schütten, leitet diese spezielle Konstruktion die Flüssigkeit ab.', 153, '28.79', '28.79', 199, '2022-05-25 06:59:56', '2022-05-25 13:22:10', 1),
(128, 'UK Layout 60% Mechanische Gaming-Tastatur Typ C ', 'UK Layout 60% Mechanische Gaming-Tastatur Typ C verkabelt 61 Tasten LED-beleuchtete USB-wasserdichte Tastatur 14 Chroma RGB-Hintergrundbeleuchtung Anti-Ghosting-Tasten für Computer/PC/Lapto/MAC', 154, '35.62', '35.62', 199, '2022-05-25 07:02:16', '2022-05-25 13:11:08', 1),
(129, 'LOGITECH G213 Prodigy Gaming', 'LOGITECH G213 Prodigy Gaming, Tastatur, Rubberdome, kabelgebunden, Schwarz', 154, '62.99', '62.99', 199, '2022-05-25 07:03:06', '2022-05-25 13:26:43', 1),
(130, 'Logitech G29 Driving Force Gaming Rennlenkrad', 'Logitech G29 Driving Force Gaming Rennlenkrad, Zweimotoriges Force Feedback, 900° Lenkbereich, Racing Leder-Lenkrad, Verstellbare Edelstahl Bodenpedale, für PS5, PS4, PC, Mac - Schwarz', 156, '242.60', '242.60', 198, '2022-05-25 07:04:23', '2022-05-25 13:14:14', 1),
(131, 'Thrustmaster T.Flight Stick X', 'Thrustmaster T.Flight Stick X, Joystick mit Rudersteuerung, umprogrammierbaren Tasten und Achsen, Drehgriff, integriertem Schubhebel, Schnellfeuerauslöser, PC/USB-kompatibel', 155, '38.00', '38.00', 199, '2022-05-25 07:05:42', '2022-05-25 13:17:22', 1),
(132, 'LOGITECH Extreme 3D Joystick', 'Sie sind ein Fan von Simulationsspielen? Dann ist der Joystick LOGITECH Extreme 3D genau das Richtige für Sie!\r\n\r\nMit der schwarzen Farbgebung passt das Gerät perfekt zum Rest Ihrer Technik. Der Controller wartet auf seinen Platz am PC und auf Einsatz. Natürlich darf bei dem Modell auch ein USB-Anschluss nicht fehlen, der heutzutage schon fast zur Standardausrüstung von Computerzubehör gehört.\r\n\r\nSignale werden mittels Kabel übertragen. Dank 12 Tasten haben Sie im Spiel alles perfekt im Griff.\r\n\r\nStundenlanger Spielspaß ist Ihnen mit dem Joystick von LOGITECH sicher!', 155, '45.99', '45.99', 199, '2022-05-25 07:06:29', '2022-05-25 13:12:29', 1),
(133, 'Titanwolf Joystick ', 'Titanwolf Joystick (Flight Stick mit HOTAS Funktion Vierweg Joystick mit stufenlosem Schubregler)', 155, '44.95', '44.95', 198, '2022-05-25 07:07:23', '2022-05-25 13:38:50', 1),
(134, 'XBOX Wireless Controller, für Xbox One / Series S/X / PC - schwarz', 'Kabelloser Controller in Schwarz\r\nVerbindung per USB/Bluetooth/Xbox-Wireless\r\nmit USB-C-Buchse\r\nkompatibel zu PC/Xbox/Android/iOS\r\nbis zu 40 Stunden Akkulaufzeit', 157, '64.90', '64.90', 198, '2022-05-25 07:08:34', '2022-05-25 13:12:29', 1),
(135, 'PlayStation 4 Wireless Controller', 'DUALSHOCK4 Wireless-Controller Jet Black v2\r\nDer DUALSHOCK 4 Wireless-Controller bietet eine Kombination aus\r\nrevolutionären Funktionen in einem intuitiven Design und präziser St\r\neuerung und definiert so eine vollkommen neue Generation des Gamings.\r\nErgonomischer Design – Entdecken Sie das elegante, super komfortable\r\nDesign und die optimierten Analog-Stick und Tasten, die für ein genaues\r\nund präzises Spiel sorgen.\r\nSHARE-Taste – Mit der SHARE-Taste können Gameplay-Videos und Screenshots\r\naus dem Spiel in sozialen Netzwerken geteilt werden. Streamen Sie live\r\nauf Twitch, YouTube und Dailymotion oder schneiden Sie aufgenommene\r\nSpielszenen und teilen diese auf Facebook und Twitter.\r\nTouchpad – Sie können mit dem interaktiven Touchpad nicht nur steuern,\r\nsondern auch gestikulieren und zeichnen – im neuen Design ist zusätzlich\r\neine Leuchtleiste intrigiert.\r\nLeuchtleiste – Die Lichtleiste bietet mit der Ausstrahlung verschiedener\r\nFarben ein personalisiertes Erlebnis und eine neue Dimension des\r\nGamings. Zudem vereinfacht es der PlayStation®Camera Ihre Position zu\r\nerfassen und somit eine verbesserte Interaktion mit der virtuellen Welt\r\nder PlayStation®VR.\r\nStereoheadset-Anschluss – Genießen Sie die extra Soundeffekte und\r\nkommunizieren Sie mit ihren Freunden via Headset.\r\nVibration Feedback – Dank der intuitiven Vibrationsmotoren und des\r\nZittern und Rütteln des Controllers fühlen Sie sich noch mehr in die\r\nactionreichen Spiele eingebunden.\r\nRemote Play – Streamem Sie ihre Spiele über das WLAN-Netzwerk auf Ihren\r\nPC oder Mac– die Zeiten, in denen Sie an den Fernseher gefesselt waren,\r\nsind vorbei!\r\nIndividuelle Einstellung – Ihr DUALSHOCK® lässt sich von Ihnen so\r\neinstellen wie es Ihnen gefällt. Sie können mit der Lautstärke var\r\niieren, die Vibration deaktivieren und die Helligkeit der Leuchtleiste anpassen um Akku zu sparen. Sie können ebenso entscheiden,\r\nob sie via Bluetooth® oder USB Kabel mit Ihrer PS4™ interagieren.', 157, '69.99', '69.99', 197, '2022-05-25 07:10:30', '2022-05-25 13:38:06', 1),
(136, 'Nacon Wired Compact Controller, Gamepad', 'Nacons kabelgebundener Compact Controller ist offiziell für PS4-Konsolen lizenziert und verfügt über eine Reihe wesentlicher Merkmale, darunter Touchpad, Vibrationsmotoren und LED-Spieler-Status-Kontrollleuchte. Außerdem bietet er Aktionstasten mit PlayStation-Symbolen und -farben sowie SHARE-, OPTIONS- und PS-Taste. Die ergonomische Form und die gummierte Oberfläche bieten überlegenen Komfort und optimale Griffigkeit für alle Arten von Spielen, auch nach langen Spielsitzungen. Mit einem 3 m langen Kabel passt er perfekt zu jedem Gaming-Setup im Wohnzimmer. Er besitzt einen Headset-Anschluss für das vollständige Eintauchen in die Lieblingsspiele. Der kabelgebundene Compact Controller ist auch PC-kompatibel (XInput) für noch mehr Vielseitigkeit.', 157, '41.99', '41.99', 199, '2022-05-25 07:12:31', '2022-05-25 13:38:50', 1),
(137, 'Sabrent 4-Port USB 2.0 Hub', 'Sabrent 4-Port USB 2.0 Hub mit einzelnen Schalter und einzelnen LEDs (HB-UMLS)', 158, '9.99', '9.99', 195, '2022-05-25 07:13:27', '2022-05-25 13:26:43', 1),
(138, 'speedlink USB-Hub SNAPPY SLIM 4-fach schwarz', 'Mit dem speedlink USB-Hub SNAPPY SLIM 4-fach schwarz können Sie Ihr Gerät einfach um zusätzliche Schnittstellen erweitern. Schließen Sie ihn einfach an und vervielfältigen Sie die Anzahl Ihrer Anschlussmöglichkeiten. Somit haben Sie nie mehr das lästige Problem fehlender Anschlüsse und haben immer einen freien Steckplatz für Ihre Peripheriegeräte parat. Weiterlesen und noch mehr interessante Informationen zu diesem Artikel erhalten!', 158, '4.98', '4.98', 197, '2022-05-25 07:14:02', '2022-05-25 13:38:06', 1),
(139, 'SPEEDLINK SNAPPY SLIM USB Hub 4-Port, USB HUB, Weiß', 'Dank des weißen USB-Hubs SPEEDLINK SNAPPY SLIM USB Hub 4-Port müssen Sie keine Geräte mehr von Ihrem Computer trennen, um zusätzliche anzuschließen.\r\n\r\nSchnelle Datenübertragung leicht gemacht: mit dem USB HUB SNAPPY SLIM USB Hub 4-Port.', 158, '4.99', '4.99', 199, '2022-05-25 07:14:44', '2022-05-25 13:25:21', 1);
